import AutoCompleteTest from "./AutoCompleteTest";
import Buttin from "./Buttin";
import MultiActionAreaCard from "./Cardtest";
import DialogTest from "./DialogTest";
import GirdTest from "./GirdTest";
import ListTest from "./ListTest";
import Menutest from "./Menutest";
import ModelTest from "./ModelTest";
import NavTest from "./NavTest";
import TabbarTest from "./TabbarTest";
import TextFill from "./TextFill";
import Type from "./Type";

function App() {
  return (
    <div className="App">
      <NavTest/><br/><br/><br/><br/>
      <Menutest/>
      <Type/>
      <TabbarTest/>
      <Buttin/>
      <GirdTest/>
      <MultiActionAreaCard/>
      <DialogTest/>
      <ModelTest/>
      <TextFill/>
      <ListTest/>
      <AutoCompleteTest/>


    </div>
  );
}

export default App;
